@ExtendWith(MockitoExtension.class)
class PetTypeFormatterTest {

	@Mock
	private PetTypeRepository types;

	@InjectMocks
	private PetTypeFormatter controller;

	@BeforeEach
	void setUp() {
		// Mockito initializes @Mock and @InjectMocks automatically
	}

	@Test
	@DisplayName("Returns the matching PetType when the provided text matches a PetType name in the collection")
	void testParseReturnsMatchingPetTypeWhenFound() {
		PetType pet = new PetType();
		pet.setName("Dog");
		when(types.findPetTypes()).thenReturn(List.of(pet));
		var result = pet.parse("Dog", Locale.ENGLISH);
		assertNotNull(result);
	}

	@Test
	@DisplayName("Throws ParseException when no PetType with the matching name is found")
	void testParseThrowsParseExceptionWhenTypeNotFound() {
		PetType pet = new PetType();
		pet.setName("Dog");
		when(types.findPetTypes()).thenReturn(List.of(pet));
		assertThrows(ParseException.class, () -> {
			pet.parse("Cat", Locale.ENGLISH);
		});
	}

	@Test
	@DisplayName("Throws ParseException when text is null and no PetType matches")
	void testParseThrowsParseExceptionWithNullText() {
		PetType pet = new PetType();
		pet.setName("Dog");
		when(types.findPetTypes()).thenReturn(List.of(pet));
		assertThrows(ParseException.class, () -> {
			pet.parse(null, Locale.ENGLISH);
		});
	}

}
